import React, { useState } from 'react';
import { NavLink } from 'react-router-dom';

function Navbar() {
  let [linkStates, setLinkStates] = useState({
    home: false,
    about: false,
    signIn: false,
    signUp: false,
  });

  let handleClick = (link) => {
    setLinkStates((prevStates) => ({
      ...prevStates,
      [link]: true,
    }));
  };

  return (
    <>
      <div className='nav-comp'>
        <a
          href='/'
          className={linkStates.home ? 'clicked' : 'not-clicked'}
          onClick={() => handleClick('home')}
        >
          Home
        </a>
        <a
          href='/About'
          className={linkStates.about ? 'clicked' : 'not-clicked'}
          onClick={() => handleClick('about')}
        >
          About Us
        </a>
        <a
          href='/SignIn'
          className={linkStates.signIn ? 'clicked' : 'not-clicked'}
          onClick={() => handleClick('signIn')}
        >
          Sign In
        </a>
        <a
          href='/SignUp'
          className={linkStates.signUp ? 'clicked' : 'not-clicked'}
          onClick={() => handleClick('signUp')}
        >
          Sign Up
        </a>
      </div>
    </>
  );
}

export default Navbar;
